import ReservatoriosDeAgua from "./pages/ReservatoriosDeAgua"

const routes = [
    {
        path: "/",
        component: ReservatoriosDeAgua
    },
    {
        path: "/reservatorios",
        component: ReservatoriosDeAgua
    },
    /*
    {
      path: "/reservatorios",
      component: ReservatoriosDeAgua,
      routes: [
        {
          path: "/reservatorios/norte",
          component: ReservatoriosDeAgua
        },
        {
          path: "/reservatorios/sul",
          component: ReservatoriosDeAgua
        }
      ]
    }
    */
]

export default routes
